INSERT INTO `tbCubeCart_documents` (`doc_id`, `doc_parent_id`, `doc_status`, `doc_order`, `doc_terms`, `doc_home`, `doc_lang`, `doc_name`, `doc_content`, `doc_url`, `doc_url_openin`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `navigation_link`, `doc_parse`, `hide_title`, `doc_privacy`) VALUES (1, 0, 1, 1, 0, 1, 'en-GB', 'Wine Of the Night', '<div><img src="skins/foundation/images/wine_logos/Title2.gif" /></div>\r\n\r\n<ul class="bxslider">\r\n	<li><img src="skins/foundation/images/wine_logos/slide1.jpg" /></li>\r\n	<li><img src="skins/foundation/images/wine_logos/slide2.jpg" /></li>\r\n	<li><img src="skins/foundation/images/wine_logos/slide3.jpg" /></li>\r\n	<li><img src="skins/foundation/images/wine_logos/slide4.jpg" /></li>\r\n	<li><img src="skins/foundation/images/wine_logos/slide5.jpg" /></li>\r\n</ul>\r\n\r\n<h3><span style="color:#F00;"><strong>Great news</strong></span> Grand Opening.<img alt="laugh" height="23" src="http://wineofthenight.com.hk/includes/ckeditor/plugins/smiley/images/teeth_smile.png" title="laugh" width="23" />&nbsp;<span style="color:#00F;">Our online shop will be launched in August,&nbsp;</span><span style="color:#F00;"><strong>STAY TUNNED</strong></span>.&nbsp;&nbsp;</h3>\r\n', '', 0, '', '', '', 1, 0, '1', 0);
INSERT INTO `tbCubeCart_documents` (`doc_id`, `doc_parent_id`, `doc_status`, `doc_order`, `doc_terms`, `doc_home`, `doc_lang`, `doc_name`, `doc_content`, `doc_url`, `doc_url_openin`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `navigation_link`, `doc_parse`, `hide_title`, `doc_privacy`) VALUES (2, 0, 1, 2, 0, 0, 'en-GB', 'About Us', '<p>We started drinking and collecting Burgundy Champagne and other fine wines ten years ago. For the past ten years, we have tasted many fine wines in our Burgundy drinking group. Our team consists of wine specialists and wine lover like me not in the wine industry before and now devote all my time to wines!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There are many big retail wine stores in Hong Kong! We don&#39;t have the biggest collection but as you go through our&nbsp;wine list, our collection consists mainly of highly sought after wines. Because our philosophy is stocking wines in good vintages only and quality wines with a low yield and production. Wine priced with a middle price range that has a raising potential.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our objective is to foresee the wine trend pick up some quality wines with a reasonable price range and sell them quickly to our customers before the next price rise. In return, we get our profits and invest in the next sets of wines and sell them to our customers again.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Wish every customer have a happy buying experience with us and may that bottle of wine be your Wine Of The Night!</p>\r\n', '', 0, '', '', '', 1, 0, '0', 0);
INSERT INTO `tbCubeCart_documents` (`doc_id`, `doc_parent_id`, `doc_status`, `doc_order`, `doc_terms`, `doc_home`, `doc_lang`, `doc_name`, `doc_content`, `doc_url`, `doc_url_openin`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `navigation_link`, `doc_parse`, `hide_title`, `doc_privacy`) VALUES (3, 0, 1, 3, 1, 0, 'en-GB', 'Terms and Conditions', '<p>Please read these terms and conditions carefully as they affect your rights and liabilities under the law and set out the terms under which Wine Of The Night makes the products available to you&nbsp;</p>\r\n\r\n<p><strong>Sales</strong></p>\r\n\r\n<p>Under the Hong Kong law, it is a criminal offense to sell alcohol to people under the age of 18. By placing an order, the customer confirms that he/she is 18 years old or above.&nbsp;</p>\r\n\r\n<p><strong>Prices</strong></p>\r\n\r\n<p>The prices (Hong Kong Dollars &ndash; $HK) payable for the wine that you order are clearly set out on the website. We put every effort to ensure the price stated should be correct. It is rarely seen but if by mistake, we have under-priced an item, we reserve the rights not to supply that item to you at that stated price. We will notify you the new price before we dispatch the item concerned or refund any payment received in any disagreement of the new price.</p>\r\n\r\n<p><strong>Payment</strong></p>\r\n\r\n<p>Payment shall be due immediately upon receipt of invoice, except for approved trade account. Method of payment may be in the form of HKD Cash or by bank transfer. Once payment has been received goods will be delivered.&nbsp;</p>\r\n\r\n<p><strong>Availability</strong></p>\r\n\r\n<p>If for any reason beyond our reasonable control, we are unable to supply a particular item, we will notify you as soon as possible. For example, the last bottle of wine fell on the floor!</p>\r\n\r\n<p>We reserve the rights not able to supply the wines for any unlucky reasons and if we have received payments we will refund.</p>\r\n\r\n<p><strong>Photo&nbsp;</strong></p>\r\n\r\n<p>The photo display may not be exactly the wine you are going to receive.&nbsp;</p>\r\n\r\n<p>We may use another vintage photo for display rather than the actual vintage.</p>\r\n\r\n<p><strong>Delivery</strong></p>\r\n\r\n<p>Wine Of The Night offers one destination door to door delivery service within our delivery area range (please ask) for any purchase at the cost of HK$3000 or above. For purchase under HK $3000 there will negotiate a price for door to door delivery according to the district. Alternatively, we can offer free scheduling pickups for over $1500 purchases at designated MTR station.</p>\r\n\r\n<p>Delivery to Hong Kong, Kowloon, and New Territories, excluding outlying islands. The Company reserves the right to charge for re-delivery of orders which have not been completed due to incorrect address information provided by the Customer or the recipient not being available to accept delivery at the scheduled time slot.</p>\r\n\r\n<p><strong>Exchange and Refund Policy</strong></p>\r\n\r\n<p>All goods sold under normal circumstances are not exchangeable nor refundable. The Customer is requested to examine the goods immediately upon delivery for any deficiencies and/or damages. Any intended claims or complaints (if any) must be made known to us at the time of delivery; otherwise, we shall have the discretion to refuse any claim after delivery.&nbsp;</p>\r\n\r\n<p>We are selling very limited rare bottles of burgundy wine which is carefully sourced and we are trustworthy. There is a risk in buying these wines and all collectors should know. Therefore refund and exchange is not applicable&nbsp;</p>\r\n\r\n<p>In the event that you would like to claim an exchange of goods, please contact us within 3 days from the date of delivery and presenting to us a valid invoice. We do not accept exchange or refund for wines over HK$750 per bottle and/or more than 10 years old. Wine Of The Night reserve the rights to decide if we exchange or refund.</p>\r\n', '', 0, '', '', '', 1, 0, '0', 0);
