INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (1, 'admin.password_recovery', 'en-GB', 'Admin Password Recovery', '<p>Dear {$DATA.name},</p>\n<p>To regain access to the stores administration control panel. Please follow the link below:</p>\n<p><a href="{$DATA.link}">{$DATA.link}</a></p>\n<p>If the link above doesn''t work, please copy and paste it into your browser address bar.</p>', 'Dear {$DATA.name},\n\nTo regain access to the stores administration control panel. Please follow the link below:\n\n{$DATA.link}\n\nIf the link above doesn''t work, please copy and paste it into your browser address bar.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (2, 'cart.order_complete', 'en-GB', 'Order Complete', '<p>Hi {$DATA.first_name|capitalize},</p>\n<p>We are pleased to say that order number {$DATA.cart_order_id} is complete. If you have ordered physical goods they should arrive shortly.</p>', 'Hi {$DATA.first_name|capitalize},\n\nWe are pleased to say that order number {$DATA.cart_order_id} is complete. If you have ordered physical goods they should arrive shortly.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (3, 'cart.order_cancelled', 'en-GB', 'Order Cancelled', '<p>Hi {$DATA.first_name|capitalize},</p>\n<p>Order number {$DATA.cart_order_id} has been cancelled.</p>', 'Hi {$DATA.first_name|capitalize},\n\nOrder number {$DATA.cart_order_id} has been cancelled.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (4, 'cart.order_confirmation', 'en-GB', 'Order Confirmation #{$DATA.cart_order_id}', '<p>Thank You {$DATA.first_name|capitalize}!</p>\n<p>Your order {$DATA.cart_order_id} has been received which was placed on {$DATA.order_date}. Please keep this email for your records. It is possible to view the status of your order online.</p> \n<p><a href="{$DATA.link}">{$DATA.link}</a></p>\n<table width="100%">\n<tr>\n<td valign="top" width="50%"><strong>Billing address:</strong><br>\n{$BILLING.first_name|capitalize} {$BILLING.last_name|capitalize}<br>\n{if !empty($BILLING.company_name)}{$BILLING.company_name}<br>\n{/if}\n{$BILLING.line1|capitalize}<br>\n{if !empty($BILLING.line2)}{$BILLING.line2|capitalize}<br>\n{/if}\n{$BILLING.town|upper}<br>\n{if !empty($BILLING.state)}{$BILLING.state|upper}<br>{/if}\n{$BILLING.postcode}<br>\n{$BILLING.country}<br>\n{$BILLING.phone}<br>\n<br>\n<strong>Email:</strong><br>\n{$BILLING.email}</td>\n<td valign="top" width="50%"><strong>Shipping address:</strong><br>\n{$SHIPPING.first_name|capitalize} {$SHIPPING.last_name|capitalize}<br>\n{if !empty($SHIPPING.company_name)}{$SHIPPING.company_name} <br>\n{/if}{$SHIPPING.line1|capitalize}<br>\n{if !empty($SHIPPING.line2)}{$SHIPPING.line2|capitalize} <br>\n{/if}{$SHIPPING.town|upper}<br>\n{if !empty($SHIPPING.state)}{$SHIPPING.state|upper}<br>{/if}\n{$SHIPPING.postcode}<br>\n{$SHIPPING.country}</td>\n</tr>\n</table>\n<table border="0" cellpadding="3" cellspacing="0" width="100%">\n<tbody>\n<tr>\n<td><strong>Item</strong></td>\n<td><strong>Quantity</strong></td>\n<td><strong>Cost</strong></td>\n</tr>\n{foreach from=$PRODUCTS item=product}\n<tr>\n<td>{$product.name} <br>{$product.product_options}</td>\n<td>{$product.quantity}</td>\n<td>{$product.price}</td>\n</tr>\n{/foreach}\n<tr>\n<td>&nbsp;</td>\n<td> {if !empty($DATA.ship_method)}{$DATA.ship_method}:{if !empty($DATA.ship_product)} ({$DATA.ship_product}){/if}{else}Shipping:{/if}</td>\n<td> {$DATA.shipping}</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td> Discount:</td>\n<td> {$DATA.discount}</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td> Subtotal:</td>\n<td> {$DATA.subtotal}</td>\n</tr>\n{foreach from=$TAXES item=tax}\n<tr>\n<td>&nbsp;</td>\n<td> {$tax.tax_name}: ({$tax.tax_percent}%)</td>\n<td> {$tax.tax_amount}</td>\n</tr>\n{/foreach}\n<tr>\n<td>&nbsp;</td>\n<td><strong>Order Total: </strong></td>\n<td><strong>{$DATA.total}</strong></td>\n</tr>\n</tbody>\n</table>\n{if !empty($DATA.note_to_customer)}\n<p>&quot;{$DATA.note_to_customer}&quot;</p>\n{/if}', 'Thank You {$DATA.first_name|capitalize}!\n\nYour order {$DATA.cart_order_id} has been received which was placed on {$DATA.order_date}. Please keep this email for your records. It is possible to view the status of your order online. \n\n{$DATA.link}\n\n----------------------------------------------------------------------\nBilling address:\n{$BILLING.first_name|capitalize} {$BILLING.last_name|capitalize}\n{if !empty($BILLING.company_name)}{$BILLING.company_name}\n{/if}{$BILLING.line1|capitalize}\n{if !empty($BILLING.line2)}{$BILLING.line2|capitalize}\n{/if}{$BILLING.town|upper}\n{if !empty($BILLING.state)}{$BILLING.state|upper}\n{/if}{$BILLING.postcode}\n{$BILLING.country}\n{$BILLING.phone}\n\nEmail:\n{$BILLING.email}\n\nShipping address:\n{$SHIPPING.first_name|capitalize} {$SHIPPING.last_name|capitalize}\n{if !empty($SHIPPING.company_name)}{$SHIPPING.company_name}\n{/if}{$SHIPPING.line1|capitalize}\n{if !empty($SHIPPING.line2)}{$SHIPPING.line2|capitalize}\n{/if}{$SHIPPING.town|upper}\n{if !empty($SHIPPING.state)}{$SHIPPING.state|upper}\n{/if}{$SHIPPING.postcode}\n{$SHIPPING.country}\n\n----------------------------------------------------------------------\nItems in Your Order\n\n{foreach from=$PRODUCTS item=product}\n-----------------------------------\n{$product.name}\n{$product.product_options}\n\nPart Number: {$product.product_code}\nUnit Price: {$product.price}\nQty: {$product.quantity}\n\n{/foreach}\n-----------------------------------\nSubtotal: {$DATA.subtotal}\nDiscount: {$DATA.discount}\n{if !empty($DATA.ship_method)}{$DATA.ship_method}:{if !empty($DATA.ship_product)} ({$DATA.ship_product}){/if}{else}Shipping:{/if} {$DATA.shipping}\n{foreach from=$TAXES item=tax}{$tax.tax_name} ({$tax.tax_percent}%): {$tax.tax_amount}\n{/foreach}\n--------------------------\nOrder Total: {$DATA.total}\n==========================\n{if !empty($DATA.note_to_customer)}\n"{$DATA.note_to_customer}"{/if}');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (5, 'cart.payment_fraud', 'en-GB', 'Order Problem', '<p>Hi {$DATA.first_name|capitalize},</p>\n<p>We are very sorry but we have not been able to accept the payment for order {$DATA.cart_order_id}. Please feel free to contact a member of staff if you have any questions.</p>', 'Hi {$DATA.first_name|capitalize},\n\nWe are very sorry but we have not been able to accept the payment for order {$DATA.cart_order_id}. Please feel free to contact a member of staff if you have any questions.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (6, 'account.password_recovery', 'en-GB', 'Password Recovery', '<p>Dear {$DATA.first_name|capitalize} {$DATA.last_name|capitalize},<br>\n<br>\nTo reset your password, please click on the link below or copy and paste the address onto your web browser''s address window. Once you''re on the web page, you will be instructed to enter and confirm your new password.<br> \n<br>\n<a href="{$DATA.reset_link}">{$DATA.reset_link}</a><br>\n<br>\nIf you require further assistance in resetting your password, please contact us.</p>', 'Hi {$DATA.first_name|capitalize},\n\nTo reset your password, please click on the link below or copy and paste the address onto your web browser''s address window. Once you''re on the web page, you will be instructed to enter and confirm your new password.\n\n{$DATA.reset_link}\n\nIf you require further assistance in resetting your password, please contact us.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (7, 'admin.order_received', 'en-GB', 'New Order #{$DATA.cart_order_id}', '<p>{$DATA.first_name|capitalize} {$DATA.last_name|capitalize} {if !empty($BILLING.company_name)}({$BILLING.company_name}){/if} just placed order number {$DATA.cart_order_id} on {$DATA.order_date}.</p>\n<p>This order can be managed online by following the link below.</p>\n<p><a href="{$DATA.link}">{$DATA.link}</a></p>\n<table width="100%">\n<tr>\n<td valign="top" width="50%"><strong>Billing address:</strong><br>\n{$BILLING.first_name|capitalize} {$BILLING.last_name|capitalize}<br>\n{if !empty($BILLING.company_name)}{$BILLING.company_name}<br>\n{/if}\n{$BILLING.line1|capitalize}<br>\n{if !empty($BILLING.line2)}{$BILLING.line2|capitalize}<br>\n{/if}\n{$BILLING.town|upper}<br>\n{if !empty($BILLING.state)}{$BILLING.state|upper}<br>{/if}\n{$BILLING.postcode}<br>\n{$BILLING.country}<br>\n{$BILLING.phone}<br>\n<br>\n<strong>Email:</strong><br>\n{$BILLING.email}</td>\n<td valign="top" width="50%"><strong>Shipping address:</strong><br>\n{$SHIPPING.first_name|capitalize} {$SHIPPING.last_name|capitalize}<br>\n{if !empty($SHIPPING.company_name)}{$SHIPPING.company_name} <br>\n{/if}{$SHIPPING.line1|capitalize}<br>\n{if !empty($SHIPPING.line2)}{$SHIPPING.line2|capitalize} <br>\n{/if}{$SHIPPING.town|upper}<br>\n{if !empty($SHIPPING.state)}{$SHIPPING.state|upper}<br>{/if}\n{$SHIPPING.postcode}<br>\n{$SHIPPING.country}</td>\n</tr>\n</table>\n<table border="0" cellpadding="3" cellspacing="0" width="100%">\n<tbody>\n<tr>\n<td><strong>Item</strong></td>\n<td><strong>Quantity</strong></td>\n<td><strong>Cost</strong></td>\n</tr>\n{foreach from=$PRODUCTS item=product}\n<tr>\n<td>{$product.name} <br>{$product.product_options}</td>\n<td>{$product.quantity}</td>\n<td>{$product.price}</td>\n</tr>\n{/foreach}\n<tr>\n<td>&nbsp;</td>\n<td> {if !empty($DATA.ship_method)}{$DATA.ship_method}:{if !empty($DATA.ship_product)} ({$DATA.ship_product}){/if}{else}Shipping:{/if}</td>\n<td> {$DATA.shipping}</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td> Discount:</td>\n<td> {$DATA.discount}</td>\n</tr>\n<tr>\n<td>&nbsp;</td>\n<td> Subtotal:</td>\n<td> {$DATA.subtotal}</td>\n</tr>\n{foreach from=$TAXES item=tax}\n<tr>\n<td>&nbsp;</td>\n<td> {$tax.tax_name}: ({$tax.tax_percent}%)</td>\n<td> {$tax.tax_amount}</td>\n</tr>\n{/foreach}\n<tr>\n<td>&nbsp;</td>\n<td><strong>Order Total: </strong></td>\n<td><strong>{$DATA.total}</strong></td>\n</tr>\n</tbody>\n\n</table>', '{$DATA.first_name|capitalize} {$DATA.last_name|capitalize} {if !empty($BILLING.company_name)}({$BILLING.company_name}){/if} just placed order number {$DATA.cart_order_id} on {$DATA.order_date}.\n\nThis order can be managed online by following the link below.\n\n{$DATA.link}\n\n----------------------------------------------------------------------\nBilling address:\n{$BILLING.first_name|capitalize} {$BILLING.last_name|capitalize}\n{if !empty($BILLING.company_name)}{$BILLING.company_name}\n{/if}{$BILLING.line1|capitalize}\n{if !empty($BILLING.line2)}{$BILLING.line2|capitalize}\n{/if}{$BILLING.town|upper}\n{if !empty($BILLING.state)}{$BILLING.state|upper}\n{/if}{$BILLING.postcode}\n{$BILLING.country}\n{$BILLING.phone}\n\nEmail:\n{$BILLING.email}\n\nShipping address:\n{$SHIPPING.first_name|capitalize} {$SHIPPING.last_name|capitalize}\n{if !empty($SHIPPING.company_name)}{$SHIPPING.company_name}\n{/if}{$SHIPPING.line1|capitalize}\n{if !empty($SHIPPING.line2)}{$SHIPPING.line2|capitalize}\n{/if}{$SHIPPING.town|upper}\n{if !empty($SHIPPING.state)}{$SHIPPING.state|upper}\n{/if}{$SHIPPING.postcode}\n{$SHIPPING.country}\n\n----------------------------------------------------------------------\nItems in Your Order\n\n{foreach from=$PRODUCTS item=product}\n-----------------------------------\n{$product.name}\n{$product.product_options}\n\nPart Number: {$product.product_code}\nUnit Price: {$product.price}\nQty: {$product.quantity}\n\n{/foreach}\n-----------------------------------\nSubtotal: {$DATA.subtotal}\nDiscount: {$DATA.discount}\n{if !empty($DATA.ship_method)}{$DATA.ship_method}:{if !empty($DATA.ship_product)} ({$DATA.ship_product}){/if}{else}Shipping:{/if} {$DATA.shipping}\n{foreach from=$TAXES item=tax}{$tax.tax_name} ({$tax.tax_percent}%): {$tax.tax_amount}\n{/foreach}\n--------------------------\nOrder Total: {$DATA.total}\n==========================');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (8, 'admin.review_added', 'en-GB', 'New Product Review', '{$DATA.name} has submit a new review/comment about ''{$DATA.product_name}''. This can be moderated following the link below.\n        <p><strong>Moderation Link:</strong><br><a href=''{$DATA.link}''>{$DATA.link}</a></p>\n        <p><strong>Review Text:</strong><br>{$DATA.review}</p>', '{$DATA.name} has submit a new review/comment about ''{$DATA.product_name}''. This can be moderated following the link below.\n\nModeration Link:\n{$DATA.link}\nReview Text:\n{$DATA.review}');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (9, 'cart.digital_download', 'en-GB', 'Your Purchased Downloads', '<p>Hi {$DATA.first_name|capitalize},</p>\n<p>Your digital files are now ready for download. Please use the links provided below to access them below:</p>\n{foreach from=$DOWNLOADS item=download}\n<p><strong>{$download.name}:</strong> (Link expires on {$download.expire}<strong>)</strong><br>\n<a href="{$download.url}">{$download.url}</a></p>\n{/foreach}\n<p>If the links above don''t work, please try copy and pasting them it into your browser address bar. You can also find access to these files from your the customer area of our website.</p> \n<p>&nbsp;</p>', 'Hi {$DATA.first_name|capitalize},\n\nYour digital files are now ready for download. Please use the links provided below to access them below:\n\n{foreach from=$DOWNLOADS item=download}\n{$download.name}: (Link expires on {$download.expire})\n{$download.url}\n{/foreach}\n\nIf the links above don''t work, please try copy and pasting them it into your browser address bar. You can also find access to these files from your the customer area of our website.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (10, 'cart.gift_certificate', 'en-GB', 'Your Gift Card', '<p>Dear {$DATA.name},</p>\n<p>We are pleased to be sending you this gift card which you can use towards the purchase of any items on our website.</p>\n<p><strong>From: </strong>{$DATA.first_name|capitalize} {$DATA.last_name|capitalize}<br>\n<strong>Amount: </strong>{$DATA.value}<br>\n<strong>Claim Code:</strong> {$DATA.code}<br>\n<strong>Gift Message:</strong> {$DATA.message}</p>\n<p>-------------------</p>\n<p>To redeem this gift card please enter the &quot;Claim Code&quot; above into the text field labeled &quot;Promotional code or gift card&quot; during checkout.</p>\n<p>Why not spend it now?</p>', 'Dear {$DATA.name},\n\nWe are pleased to be sending you this gift card which you can use towards the purchase of any item(s) on our website.\n\nHappy shopping!\n\nFrom: {$DATA.first_name|capitalize} {$DATA.last_name|capitalize}\nAmount: {$DATA.value}\nClaim Code: {$DATA.code}\nGift Message: {$DATA.message}\n\n-------------------\n\nTo redeem this gift card please enter the "Claim Code" above into the text field labeled "Promotional code or gift card" during checkout.\n\nWhy not spend it now?');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (11, 'catalogue.tell_friend', 'en-GB', '{$DATA.from} has recommended something', 'Dear {$DATA.to},\n<p>Your friend <strong>{$DATA.from}</strong> thought that you might be interested in <strong>{$DATA.name}</strong>.</p>\n<p><strong>Product Link:</strong> <a href="{$DATA.link}">{$DATA.name}</a></p>\n<p>{$DATA.message}</p>', 'Dear {$DATA.to},\n\nYour friend {$DATA.from} thought that you might be interested in ''{$DATA.name}''.\n\n{$DATA.name}\nProduct Link: {$DATA.link}\n\n{$DATA.message}');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (12, 'cart.payment_received', 'en-GB', 'Thank you for your payment!', '<p>Hi {$DATA.first_name|capitalize},</p>\n<p>Thank you. We have received a payment of {$DATA.total} for order number {$DATA.cart_order_id}.</p>', 'Hi {$DATA.first_name|capitalize},\n\nThank you. We have received a payment of {$DATA.total} for order number {$DATA.cart_order_id}.');
INSERT INTO `tbCubeCart_email_content` (`content_id`, `content_type`, `language`, `subject`, `content_html`, `content_text`) VALUES (13, 'newsletter.verify_email', 'en-GB', 'Confirm your subscription', '<p>{$DATA.email} has been subscribed to our newsletter. To confirm your subscription please follow the link below:</p><p><a href="{$DATA.link}">{$DATA.link}</a></p>', '{$DATA.email} has been subscribed to our newsletter.\n\nTo confirm your subscription please follow the link below:\n\n{$DATA.link}');
INSERT INTO `tbCubeCart_email_template` (`template_id`, `template_default`, `title`, `content_html`, `content_text`) VALUES (1, '1', 'Default Emails', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html>\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />\r\n<style type="text/css">\r\nhtml, body, table {\r\n	font-family: Arial;\r\n	font-size: 14px;\r\n}\r\n</style>\r\n<title>Default HTML Template</title>\r\n<base href="{$DATA.storeURL}" />\r\n</head>\r\n<body bgcolor="#f7f7f7">\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n  <tbody>\r\n    <tr>\r\n      <td align="center"><table bgcolor="#ffffff" border="0" cellpadding="15" cellspacing="0" width="580">\r\n          <tbody>\r\n            <tr>\r\n              <td><a href="{$DATA.storeURL}"><img alt="{$DATA.storeName}" border="0" src="{$DATA.logoURL}" style="max-width: 580px" /></a></td>\r\n            </tr>\r\n            <tr>\r\n              <td> {$EMAIL_CONTENT}</td>\r\n            </tr>\r\n            <tr>\r\n              <td><p> Kind regards,</p>\r\n                <p> The {$DATA.storeName} Staff<br />\r\n                  <a href="{$DATA.storeURL}">{$DATA.storeURL}</a></p></td>\r\n            </tr>\r\n          </tbody>\r\n        </table></td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n</body>\r\n</html>', '{$EMAIL_CONTENT}\r\n\r\nKind regards,\r\n\r\nThe {$DATA.storeName} Staff\r\n{$DATA.storeURL}');
INSERT INTO `tbCubeCart_email_template` (`template_id`, `template_default`, `title`, `content_html`, `content_text`) VALUES (2, '0', 'Default Newsletter', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html>\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />\r\n<style type="text/css">\r\nhtml, body, table {\r\n	font-family: Arial;\r\n	font-size: 14px;\r\n}\r\n</style>\r\n<title>Default HTML Newsletter Template</title>\r\n<base href="{$DATA.storeURL}" />\r\n</head>\r\n<body bgcolor="#f7f7f7">\r\n<table border="0" cellpadding="0" cellspacing="0" width="100%">\r\n  <tbody>\r\n    <tr>\r\n      <td align="center"><table bgcolor="#ffffff" border="0" cellpadding="15" cellspacing="0" width="580">\r\n          <tbody>\r\n            <tr>\r\n              <td><a href="{$DATA.storeURL}"><img src="{$DATA.logoURL}" style="max-width: 580px" alt="{$DATA.storeName}" border="0" /></a></td>\r\n            </tr>\r\n            <tr>\r\n              <td>{$EMAIL_CONTENT}</td>\r\n            </tr>\r\n            <tr>\r\n              <td><p>Kind regards,</p>\r\n                <p>The {$DATA.storeName} Staff<br />\r\n                  <a href="{$DATA.storeURL}">{$DATA.storeURL}</a></p>\r\n                <hr size="1" />\r\n                <p><font size="2">To unsubscribe please follow the link below:<br />\r\n                  <a href="{$DATA.unsubscribeURL}">{$DATA.unsubscribeURL}</a></font></p></td>\r\n            </tr>\r\n          </tbody>\r\n        </table></td>\r\n    </tr>\r\n  </tbody>\r\n</table>\r\n</body>\r\n</html>', '{$EMAIL_CONTENT}\r\n\r\nKind regards,\r\n\r\nThe {$DATA.storeName} Staff\r\n{$DATA.storeURL}\r\n\r\n-------------------\r\n\r\nTo unsubscribe please follow the link below:\r\n{$DATA.unsubscribeURL}');
