INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (5, 1, 'HUBXU17O36', 1, '<h3><strong>Tasting notes</strong>:&nbsp;<br />\r\nRobert Parker Wine Advocate: 93/100 The Gevrey-Chambertin 1er Cru La Perriere 2012 has a more exotic bouquet compared to other Premier Crus from the estate with touches of fresh fig marmalade and small red berries. medium-bodied with fine tannins and here the exoticism of the nose gives way to the minerality of the terroir, making the finish straight and linear.&nbsp;</h3>\r\n', '', 890.00, 890.00, 890.00, 'HUBERT LIGNIER GEVREY CHAMBERTIN 1ER CRU LA PERRIERE 2012', 5, 53, 5, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'HUBERT LIGNIER GEVREY CHAMBERTIN 1ER CRU LA PERRIERE 2012', '', 'Red Burgundy HUBERT LIGNIER GEVREY CHAMBERTIN 1ER CRU LA PERRIERE 2012', '', '', '', '', NULL, '', '', '', '2018-06-07 13:56:53', '2018-06-09 04:13:17', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (6, 1, 'PHI5NEKL33', 1, '<h3><strong>Tasting notes:&nbsp;</strong><br />\r\nWA - The 2010 Gevrey-Chambertin Champs-Chenys Vieilles Vignes is youthful but expressive, opening in the glass with a nose of stewed plums, glossy black cherry, meaty soil tones and a subtle and nicely integrated framing of oak. On the palate, the wine is supple, expansive and quite open-knit, though appropriately deep and resolved at the core, with good acidity and ripe, savory tannins. A very fine village Gevrey that shows its propinquity to Charmes-Chambertin in style and character if not a dimension.<br />\r\nWilliam Kelley - 31/01/2018</h3>\r\n', '', 980.00, 980.00, 980.00, 'Philippe Roty Gevrey-Chambertin Champs-Chenys Vieilles Vignes 2010', 5, 94, 3, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Philippe Roty Gevrey-Chambertin Champs-Chenys Vieilles Vignes 2010', '', 'Red Burgundy Philippe Roty Gevrey-Chambertin Champs-Chenys Vieilles Vignes 2010', '', '', '', '', NULL, '', '', '', '2018-06-07 13:59:39', '2018-06-09 04:14:58', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (7, 1, 'DOMD0BDE86', 1, '<h3><strong>Tasting notes</strong>:</h3>\r\n\r\n<h3>**Note: also from 60 to 70-year-old vines**?A perfumed if somewhat Sauvage nose features a complex and expressive aromatic profile of red and blue pinot fruit, humid earth and black cherry notes where the earthiness very much infuses the rich, serious and impressively concentrated medium weight flavors that possess excellent detail on the robust, balanced and mouth coating finish.<br />\r\nScore: 90/92<br />\r\nAllen Meadows, Burghound.com (37), January 2012</h3>\r\n', '', 1120.00, 1120.00, 1120.00, 'Domaine Bachelet Gevrey Corbeaux 2008', 5, 51, 9, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Bachelet Gevrey Corbeaux 2008', '', 'Red Burgundy Domaine Bachelet Gevrey Corbeaux 2008', '', '', '', '', NULL, '', '', '', '2018-06-07 14:04:22', '2018-06-09 04:14:01', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (8, 1, 'DOMTALK332', 1, '<h3><strong>Tasting notes :&nbsp;</strong><br />\r\n**Note: contains some premier cru juice from Fuees**?This is also quite fresh and bright if not quite as ripe with high-toned and very Chambolle-like red berry fruit and wet stone aromas that lead to lacy, pure and refined middle weight flavors that are the epitome of finesse and harmony. This is not only a lovely village but it&#39;s also one that is less obviously marked by the vintage. Excellent and this too is recommended.<br />\r\nScore: 90<br />\r\nAllen Meadows, Burghound.com (45), January 2012</h3>\r\n', '', 1880.00, 1880.00, 1880.00, 'Domaine Georges Roumier Chambolle Musigny 2009', 5, 134, 8, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Georges Roumier Chambolle Musigny 2009', '', 'Burgundy Red Domaine Georges Roumier Chambolle Musigny 2009', '', '', '', '', NULL, '', '', '', '2018-06-07 14:06:13', '2018-06-09 04:17:43', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (9, 1, 'DOMPVRWS85', 1, '<h3><strong>Tasting notes :&nbsp;</strong><br />\r\n**Note: 1.5 ha of vines situated in Aux Saules, La Vigneux, Les Barreaux and Les Jacques**?Moderate wood influence frames the otherwise ripe aromas of red currant, blueberry and plum that lead to nicely rich and round middle weight flavors that possess good punch and fine delineation. There is better extract and this delicious effort is very Vosne in character, all wrapped in a solidly persistent finish.<br />\r\nScore: 87/89</h3>\r\n', '', 2220.00, 2220.00, 2220.00, 'Domaine Emmanuel Rouget Vosne Romanee 2010', 5, 57, 3, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Emmanuel Rouget Vosne Romanee 2010', '', 'Burgundy Red Domaine Emmanuel Rouget Vosne Romanee 2010', '', '', '', '', NULL, '', '', '', '2018-06-07 14:07:56', '2018-06-09 04:12:22', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (10, 1, 'DOM0N35045', 1, '<p><strong>Tasting notes :</strong>&nbsp;</p>\r\n\r\n<h3>An elegant and complex melange of both natural and wood spice adds breadth to the perfumed red berry liqueur and plum aromas that merge into rich, delicious and equally complex middle weight flavors that exude a fine minerality on the wonderfully long and sappy finish. This is an excellent village and highly recommended.<br />\r\nScore: 89/92</h3>\r\n', '', 1890.00, 1890.00, 1890.00, 'Domaine Emmanuel Rouget Vosne Romanee 2009', 5, 54, 8, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Emmanuel Rouget Vosne Romanee 2009', '', 'Red Burgundy Domaine Emmanuel Rouget Vosne Romanee 2009', '', '', '', '', NULL, '', '', '', '2018-06-07 14:09:27', '2018-06-09 04:15:50', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (11, 1, 'DOM8CUUA2', 1, '<h3><strong>Tasting notes :&nbsp;</strong><br />\r\nThis is also quite ripe but, not surprisingly, much spicier with floral, plum and black raspberry aromas that precede rich, intense and mocha-suffused middle weight plus flavors that are pure velvet on the seriously long finish. Villages level wines rarely get much better yet this is not even the best example in the range in 2009.<br />\r\nScore: 91/93<br />\r\nAllen Meadows, Burghound.com (41), January 2011</h3>\r\n', '', 1580.00, 1580.00, 1580.00, 'Domaine Dugat Py Vosne Romanee VV 2009', 5, 51, 9, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Dugat Py Vosne Romanee VV 2009', '', 'Burgundy Red Domaine Dugat Py Vosne Romanee VV 2009', '', '', '', '', NULL, '', '', '', '2018-06-07 14:10:56', '2018-06-09 04:18:15', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (12, 1, 'DOMGMSCJ21', 1, '<h3>The 2012 Vosne-Romanee jumps from the glass with a dark red cherry, plum, spice, and iron. Today, 2012 is a bit reduced, but not enough to detract from the wine&#39;s considerable appeal. The style is rich, textured very much on the intense side at the villages level. I imagine 2012 will still be an impressive wine at age twenty.<br />\r\nScore: 90/92<br />\r\nAntonio Galloni, vinous.com, January 2014</h3>\r\n', '', 1480.00, 1480.00, 1480.00, 'Domaine Dugat Py Vosne Romanee VV 2012', 5, 53, 12, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Dugat Py Vosne Romanee VV 2012 ', '', 'Burgundy Red Domaine Dugat Py Vosne Romanee VV 2012', '', '', '', '', NULL, '', '', '', '2018-06-07 14:12:35', '2018-06-09 04:16:26', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (13, 1, 'DOMWRDJT44', 1, '<p><strong>Tasting &nbsp;notes</strong>:&nbsp;</p>\r\n\r\n<h3>**Note: from a .1144 ha parcel of 45+-year-old vines that generally are not very productive as they give bunches with very tiny berries; aged in 50% new wood**? A moderately exotic nose of very ripe yellow fruit and honeysuckle trimmed in a touch of residual SO2 is followed by rich, full and luxurious flavors that brim with seeming buckets of dry extract yet there is a fine sense of underlying tension and precision on the balanced and hugely persistent finish. This too is an unusually dry, indeed even crisp &#39;09 with superb potential. In short, this is a knockout.<br />\r\nScore: 95 Allen Meadows, Burghound.com (47), June 2012</h3>\r\n', '', 3480.00, 3480.00, 3480.00, 'Domaine Louis Carllion Bienvenues-Batard-Montrachet Grand Cru 2009', 6, 51, 6, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Louis Carllion Bienvenues-Batard-Montrachet Grand Cru 2009', '', 'Burgundy white Domaine Louis Carillion Bienvenues-Batard-Montrachet Grand Cru 2009', '', '', '', '', NULL, '', '', '', '2018-06-07 14:16:45', '2018-06-09 06:47:24', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (14, 1, 'DOMFUR8T33', 1, '<h3><strong>Tasting &nbsp;notes:</strong>&nbsp;<br />\r\nfrom a.11 ha parcel of 43-year-old vines that generally are not very productive; aged in 50% new wood). A distinctly different aromatic profile of slightly mentholated notes accompanied by honeysuckle, citrus and white rose petal aromas that merge into rich, full and unusually powerful broad-shouldered flavors that are also on the understated side despite the size and weight. This is a seriously impressive effort and one of the stars of the vintage. Don&#39;t miss it! (93-95)/2013+&nbsp;<br />\r\nAllen Meadows&nbsp;</h3>\r\n', '', 3200.00, 3200.00, 3200.00, 'Domaine Louis Carllion Bienvenues-Batard-Montrachet Grand Cru 2005', 6, 197, 3, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Louis Carllion Bienvenues-Batard-Montrachet Grand Cru 2005', '', 'Burgundy White Domaine Louis Carillion Bienvenues-Batard-Montrachet Grand Cru 2005', '', '', '', '', NULL, '', '', '', '2018-06-07 14:19:27', '2018-06-09 06:47:10', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (15, 1, 'DOMZ8J7Z38', 1, '<h3>Tasting &nbsp;(from 31-year-old vines). This too is very floral with the barest traces of exotic fruit in the background that introduce rich, full and sweet medium-bodied flavors underpinned by more prominent minerality on the powerful, concentrated and intense finish. This is more refined than the Combettes and will require a few years to really blossom yet there is so much underlying material that it will be approachable young. (91-93)/2011+ Allen Meadows&nbsp;<br />\r\n&nbsp;</h3>\r\n', '', 890.00, 890.00, 890.00, 'Domaine Louis Carllion Puligny-Montrachet Les Perrieres 2005', 6, 53, 3, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Louis Carllion Puligny-Montrachet Les Perrieres 2005', '', 'Burgundy White Domaine Louis Carillon Puligny-Montrachet Les Perrieres 2005', '', '', '', '', NULL, '', '', '', '2018-06-07 14:21:37', '2018-06-09 06:46:56', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (16, 1, 'VINMMJKE56', 1, '<p><strong>Tasting notes</strong> :</p>\r\n\r\n<h3>An exuberantly fresh nose offers up notes of pear, green apple and wet stone where the latter element can also be found on the opulent, intense and well-detailed flavors that are an exercise in delicacy and harmony if perhaps not the sheer depth and length found on the Tete du Clos.<br />\r\n&nbsp;</h3>\r\n', '', 1750.00, 1750.00, 1750.00, 'Vincent Dancer Meursault 1er Cru Les Perrieres 2009', 6, 98, 5, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Vincent Dancer Meursault 1er Cru Les Perrieres 2009', '', 'Burgundy white Vincent Dancer Meursault 1er Cru Les Perrieres 2009', '', '', '', '', NULL, '', '', '', '2018-06-07 14:23:16', '2018-06-09 06:46:42', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (17, 1, 'BOUOPFNS81', 1, '<h3><strong>Tasting notes</strong> :</h3>\r\n\r\n<h3>Sumptuously ripe aromas of peach and apricot with a hint of toasty oak and smoke lead to full-bodied, sappy, muscular, massively scaled flavors that are breathtakingly rich and quite densely concentrated, especially on the impressively long finish and this stains and coats the palate completely. Despite all of the size, this remains impeccably balanced and as good as the La Cabotte is, the Montrachet delivers that extra dimension to surpass it by a nose, if you&#39;ll forgive the pun. Seriously beautiful juice and a great success for the vintage.<br />\r\nScore: 93<br />\r\nAllen Meadows, Burghound.com&nbsp;</h3>\r\n', '', 3480.00, 3480.00, 3480.00, 'Bouchard Pere et Fils Montrachet Grand Cru 2001', 6, 251, 4, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Bouchard Pere et Fils Montrachet Grand Cru 2001', '', 'burgundy white Bouchard Pere et Fils Montrachet Grand Cru 2001', '', '', '', '', NULL, '', '', '', '2018-06-07 14:24:42', '2018-06-09 06:46:28', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (18, 1, 'DOMUB9ML44', 1, '<h3><strong>Tasting notes :</strong><br />\r\nThere is a trace of reduction present but not so much that is completely masks the background notes of petrol, lemon rind and white orchard fruit aromas. There is good volume and an excellent sense of underlying tension to the attractively well-detailed and utterly delicious middle weight flavors that possess impressive concentration in the context of the appellation, all wrapped in a balanced, long and nicely complex finish. Good stuff here.&nbsp;<br />\r\nAllen Meadows, Burghound.com&nbsp;</h3>\r\n', '', 13800.00, 13800.00, 13800.00, 'Domaine Coche-Dury Bourgogne Blanc 2010 (Case Of Six)', 6, 192, 1, 0, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Coche-Dury Bourgogne Blanc 2010', '', 'Burgundy White Domaine Coche-Dury Bourgogne Blanc 2010', '', '', '', '', NULL, '', '', '', '2018-06-07 14:26:34', '2018-06-09 06:28:40', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (24, 1, 'DOMS1T5U12', 1, '<h3><strong>Tasting notes&nbsp;</strong></h3>\r\n\r\n<h3>Made from tiny yields, the 1994 Pinot Gris Clos Windsbuhl V.T. exhibits a light golden color, huge, smoky, buttery aromas, high acidity, currant/cherry-like flavors reminiscent of a red wine, in addition to a finish that lasts for well over a minute. It is mind-boggling in terms of its purity, extract, and balance. The wine is extremely unevolved, requiring another 4-5 years of cellaring; it should keep for 30+ years. This 1994 Pinot Gris is virtually perfect.</h3>\r\n\r\n<p>Score: 99</p>\r\n\r\n<h3>Robert Parker, Wine Advocate (105), June 1996</h3>\r\n', '', 980.00, 980.00, 980.00, 'Domaine Zind Humbrecht Pinot Gris Clos Windsbuhl VT 1994', 8, 167, 6, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Zind Humbrecht Pinot Gris Clos Windsbuhl VT 1994', '', 'France Alsace Domaine Zind Humbrecht Pinot Gris Clos Windsbuhl VT 1994', '', '', '', '', NULL, '', '', '', '2018-06-09 16:10:13', '2018-06-09 16:49:48', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (19, 1, 'DOMI0ROQ59', 1, '<h3><strong>Tasting notes</strong>:&nbsp;<br />\r\nThe outstanding* Moderate reduction is enough to hide the underlying fruit and about all that can be gleaned is that it appears ripe, indeed even mildly exotic. The layered and delicious flavors possess excellent volume and intensity before culminating in a suave and saliva-inducing finish. I like the balance and fine sense of harmony and while awkward today, this impressively persistent effort appears very promising.&nbsp;<br />\r\nScores 92, Allen Meadows, Burghound.com&nbsp;<br />\r\n&nbsp;</h3>\r\n', '', 520.00, 520.00, 520.00, 'Domaine Fontaine Gagnard Monopole Clos des Murees Chassagne Montrachet Premier Cru 2010', 6, 61, 8, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Fontaine Gagnard Monopole Clos des Murees Chassagne Montrachet Premier Cru 2010', '', 'burgundy white Domaine Fontaine Gagnard Monopole Clos des Murees Chassagne Montrachet Premier Cru  2010', '', '', '', '', NULL, '', '', '', '2018-06-07 14:27:57', '2018-06-09 06:46:13', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (20, 1, 'DOMH1YXZ49', 1, '<h3><strong>Tasting notes :&nbsp;</strong></h3>\r\n\r\n<h3>This is the first wine to display noticeable SO2 and it&#39;s enough to dominate the nose at present. There is an impressive richness to the broad-shouldered yet refined and elegant medium-bodied flavors that brim with plenty of palate coating dry extract. Despite the succulence of the mid-palate, there is excellent delineation on the citrus-infused, intense and moderately dry finish. Like the Caillerets, this is not quite as complex as I believe that it will be with time in the bottle so it would be best to allow this at least 5 years of bottle age first.<br />\r\nScore: 92 &nbsp;Allen Meadows, Burghound.com (51), June 2013</h3>\r\n', '', 598.00, 598.00, 598.00, 'Domaine Fontaine Gagnard  La Romanee ---- Chassagne Montrachet 1er Cru 2011', 6, 66, 6, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Fontaine Gagnard  La Romanee', '', 'Burgundy White Domaine Fontaine Gagnard  La Romanee Chassagne Montrachet 1er Cru  2011', '', '', '', '', NULL, '', '', '', '2018-06-07 14:30:01', '2018-06-09 06:45:57', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (21, 1, 'BOL43THK55', 1, '<h3><strong>Description:</strong><br />\r\nA pure expression of Pinot Noir, produced in small quantities only in exceptional years from a monopole four hectares vineyard in Ay. Aged for eight months in small oak barrels, la Cote aux Enfants has a very good aging potential.<br />\r\nConcentrated and powerful with aromas of elderberry, licorice, redcurrant, and cherry. A good tannic structure well balanced with an aromatic palate and great length.</h3>\r\n', '', 680.00, 680.00, 680.00, 'Bollinger La Cote aux Enfants Rouge 2009', 9, 68, 5, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Bollinger La Cote aux Enfants Rouge 2009', '', 'champagne Bollinger La Cote aux Enfants Rouge 2009', '', '', '', '', NULL, '', '', '', '2018-06-07 14:31:57', '2018-06-09 06:43:32', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (22, 1, 'EGLCTPMI40', 1, '<h3><strong>Tasting &nbsp;notes</strong>:&nbsp;<br />\r\nDisgorged only shortly before I tasted it and with 1-1.5 grams of naturally remaining residual sugar that he expects to supplement before beginning commercial disgorgement, Eglys 2004 Brut Tradition is mouthwateringly and mysteriously scented with bacon fat and beef marrow, damp forest, sea breeze and chalk dust, which in their manifestations on a polished though firm palate tug at the cheeks and salivary glands even as they stretch the imagination, the barrels in which this wine matured leaving virtually no trace. There is grip and energy galore here, and I imagine that bottles will be worth following for the better part of a decade, if not beyond. We have here, in my view, a classic example of what Ambonnay V perhaps uniquely among Champagne crus V can deliver, namely a carnal dimension normally only found in red Burgundy or Chablis with the striking intensity of mineral flavors.<br />\r\nScore: 92/93<br />\r\nDavid Schildknecht, Wine Advocate (1113), November 2013</h3>\r\n', '', 880.00, 880.00, 880.00, 'Egly Ouriet Brut Grand Cru Milesime 2004', 9, 67, 12, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Egly Ouriet Brut Grand Cru Milesime 2004', '', 'Champagne Egly Ouriet Brut Grand Cru Milesime 2004', '', '', '', '', NULL, '', '', '', '2018-06-07 14:35:40', '2018-06-09 06:44:24', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (23, 1, 'BILKZ4U258', 1, '<h3><strong>Tasting &nbsp;notes</strong>:&nbsp;</h3>\r\n\r\n<h3>Supremely elegant and aristocratic in bearing, the 2002 Rose Cuvee Elisabeth Salmon is simply exquisite. All the elements are beautifully nuanced. Above all else, the Cuvee Elisabeth is a Champagne of finesse, even in 2002. Crushed rose petals, cinnamon, and spice gradually open up in the glass, but 2002 is slow to reveal all of its charms. Readers lucky enough to own 2002 can look forward to another 20 years or so of fine drinking. Drink 2017-2032.<br />\r\nScore: 96</h3>\r\n', '', 1590.00, 1590.00, 1590.00, 'Billecart Salmon Rose Cuvee Elisabeth 2002', 9, 67, 9, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Billecart Salmon Rose Cuvee Elisabeth 2002', '', 'Champagne Billecart Salmon Rose Cuvee Elisabeth 2002', '', '', '', '', NULL, '', '', '', '2018-06-07 14:37:15', '2018-06-09 06:45:02', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (25, 1, 'DOMS34GY46', 1, '<h3><strong>Tasting Notes :</strong></h3>\r\n\r\n<h3>3/2012: the nose shows a surprising nice minerality for the Herrenweg, usually fruitier and simpler. The selection was stricter in 2010 and the proportion of older vines is more important. Yields are also very small! The palate has the structure of a tight limestone Riesling, with a crisp saline acidity. Low RS, so the finish is quite dry and long. Pity that this is a small cask as it is probably our best Herrenweg to date!</h3>\r\n', '', 298.00, 298.00, 298.00, 'Domaine Zind Humbrecht RIESLING HERRENWEG DE TURCKHEIM 2010', 8, 58, 6, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Zind Humbrecht RIESLING HERRENWEG DE TURCKHEIM 2010', '', 'France Alsace Domaine Zind Humbrecht RIESLING HERRENWEG DE TURCKHEIM 2010', '', '', '', '', NULL, '', '', '', '2018-06-09 16:15:03', '2018-06-09 16:49:27', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (26, 1, 'HENIYZP954', 1, '<h3><strong>Tasting notes:</strong></h3>\r\n\r\n<h3>Deep garnet-purple in color, the 1999 Hill of Grace presents fragrant notes of warm blackberries and black cherries with hints of menthol, dried thyme and sage, licorice, dark chocolate and black olives. Full-bodied, rich and powerful, it has firm, chewy tannins, crisp acid and a long finish. It is still very youthful in the mouth with lots of flavor layers. It is drinking well now and should continue to cellar through 2035+.</h3>\r\n\r\n<h3>Score: 97</h3>\r\n\r\n<h3>Lisa Perrotti-Brown MW, Wine Advocate (206), April 2013</h3>\r\n', '', 4080.00, 4080.00, 4080.00, 'Henschke Hill Of Grace 1999', 4, 184, 2, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Henschke Hill Of Grace 1999', '', 'Australia Henschke Hill Of Grace 1999', '', '', '', '', NULL, '', '', '', '2018-06-09 16:23:55', '2018-06-09 16:50:09', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (27, 1, 'DOMZUIQJ18', 1, '<h3><strong>Tasting notes:</strong></h3>\r\n\r\n<h3>Between 1978 and 2007, this 1998 is the greatest Vieux Telegraphe that was produced. It has taken a good decade for this wine to shed its tannins and come out of a dormant, closed period. It has finally emerged, and notes of iodine, seaweed, black currants, incense, and sweet cherries, as well as hot rocks, jump from the glass of this full-bodied, powerful wine. It possesses considerable elegance and purity, along with loads of raspberries and incense, in a round, juicy, rich style that is just emerging from the closet. The wine is still youthful and a pre-adolescent in terms of its ultimate evolution. Approachable now, it will continue to evolve for another 15-20 years. Bravo!</h3>\r\n\r\n<h3>Score: 95</h3>\r\n\r\n<h3>Robert Parker, Wine Advocate (189), June 2010</h3>\r\n', '', 780.00, 780.00, 780.00, 'Domaine Du Vieux Tlgraphe Chateauneuf du Pape La Crau 1998', 10, 490, 8, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine Du Vieux Chateauneuf du Pape La Crau 1998', 'Rhone Domaine Du Vieux Chateauneuf du Pape La Crau 1998', '', '', '', '', '', NULL, '', '', '', '2018-06-09 16:30:47', '2018-06-13 15:25:16', 0, 'new', '1', 0);
INSERT INTO `tbCubeCart_inventory` (`product_id`, `status`, `product_code`, `quantity`, `description`, `description_short`, `price`, `sale_price`, `cost_price`, `name`, `cat_id`, `popularity`, `stock_level`, `stock_warning`, `use_stock_level`, `digital`, `digital_path`, `product_weight`, `product_width`, `product_height`, `product_depth`, `dimension_unit`, `tax_type`, `tax_inclusive`, `featured`, `latest`, `seo_meta_title`, `seo_meta_description`, `seo_meta_keywords`, `upc`, `ean`, `jan`, `isbn`, `brand`, `google_category`, `gtin`, `mpn`, `date_added`, `updated`, `manufacturer`, `condition`, `available`, `minimum_quantity`) VALUES (28, 1, 'DOM2TZB887', 1, '<h3><strong>Tasting notes:</strong></h3>\r\n\r\n<h3>One of the wines of the vintage is the 2006 Chateauneuf du Pape Vieilles Vignes, and I still remember tasting this beauty at the domaine on release. Almost all Grenache and aged in tank, it has sensational notes of wild strawberries, raspberries, flowers, olive and Provencal garrigue all literally soaring from the glass. This gives way to a full-bodied, utterly seamless, weightless 2006 that has fabulous depth of fruit, fine tannin and a finish that just won&rsquo;t quit. It&rsquo;s flat out great today, but will continue knocking your socks off for another decade.</h3>\r\n\r\n<h3>Score: 97</h3>\r\n', '', 1200.00, 1200.00, 1200.00, 'Domaine de Marcoux Chateauneuf du Pape Vieilles Vignes 2006', 10, 57, 4, 1, 1, 0, '', NULL, 0.0000, 0.0000, 0.0000, 'cm', 0, 0, 1, 1, 'Domaine de Marcoux Chateauneuf du Pape Vieilles Vignes 2006', '', 'Rhone Domaine de Marcoux Chateauneuf du Pape Vieilles Vignes 2006', '', '', '', '', NULL, '', '', '', '2018-06-09 16:41:00', '2018-06-09 16:50:58', 0, 'new', '1', 0);
